import React from 'react';
import Sdata from './Sdata';

const Footer = () => {
  return (
    <h3>
      {Sdata.map((item) => {
        return (
          <div>
            <h1>{item?.data?.name}</h1>
            <h1>{item?.data?.title}</h1>
            <h1>{item?.data?.name}</h1>
          </div>
        );
      })}
    </h3>
  );
};

export default Footer;
